import{_ as a,c as r,a as d,o as n}from"./app-DSFHBrGC.js";const i={};function c(p,e){return n(),r("div",null,e[0]||(e[0]=[d('<blockquote><p>All in AI，看见未来。 每天精选最值得读的AI文章，帮你筛掉时代的噪音。 以简讯见广度，以深读见洞察。 技术、趋势、思考，一站式掌握AI世界。</p></blockquote><h1 id="_2025-05-12-资讯日报" tabindex="-1"><a class="header-anchor" href="#_2025-05-12-资讯日报"><span>2025-05-12 资讯日报</span></a></h1><h2 id="新闻资讯" tabindex="-1"><a class="header-anchor" href="#新闻资讯"><span>新闻资讯</span></a></h2><h3 id="微软财报-云与ai业务增长猛" tabindex="-1"><a class="header-anchor" href="#微软财报-云与ai业务增长猛"><span>微软财报：云与AI业务增长猛</span></a></h3><p>微软2025财年Q3财报亮眼，营收701亿美元。董事长Satya Nadella：云与AI是企业关键；CFO Amy Hood：云业务营收424亿美元，因产品需求旺，业绩强劲。<a href="https://mp.weixin.qq.com/s?__biz=Mzg3Mzg5MjY3Nw==&amp;chksm=cf0046c28178217bb5f5df15d8387ab2bd76ddf587c0d3572d1dddce466ee8c92a8a168ef1fe&amp;idx=2&amp;mid=2247520921&amp;sn=6f0fdd5a25a8027cb7266611ee041396#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><h3 id="morgan-stanley-中国gpu自给率将大增" tabindex="-1"><a class="header-anchor" href="#morgan-stanley-中国gpu自给率将大增"><span>Morgan Stanley：中国GPU自给率将大增</span></a></h3><p>Morgan Stanley：2024年中国AI GPU自给率34%，预计2027年提至82%。中国半导体自给率提升至24%，存储等领域进展好，设备和EDA低于预期，中芯国际扩产待察。<a href="https://mp.weixin.qq.com/s?__biz=MzIwMzgzNTQ1Nw==&amp;chksm=974ff2dc53f908c4f17a55e94ac94eeb35531464ffc8bf73c89d9ecd1903f7518f34bd2e3ac3&amp;idx=3&amp;mid=2247650767&amp;sn=6c010680d314dbfc8b47c93e56462511#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><h3 id="谷歌发布ai智能体白皮书" tabindex="-1"><a class="header-anchor" href="#谷歌发布ai智能体白皮书"><span>谷歌发布AI智能体白皮书</span></a></h3><p>谷歌：发布76页AI智能体白皮书，深入剖析应用前景。介绍智能体运维、评估方法，探讨多智能体架构，还提及企业应用，如NotebookLM企业版、Agentspace空间企业版，展现智能体潜力。<a href="https://mp.weixin.qq.com/s?__biz=MzI3MTA0MTk1MA==&amp;chksm=f02e4a07789a65a1ae99812e826f298dca83b21dc4f8467cdab607d357a3d4990ecb59214144&amp;idx=3&amp;mid=2652593095&amp;sn=0f3eaddbbab7aad9b43473bd4d88817e#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><h3 id="ai21-labs获3亿美元融资" tabindex="-1"><a class="header-anchor" href="#ai21-labs获3亿美元融资"><span>AI21 Labs获3亿美元融资</span></a></h3><p>AI21 Labs获3亿美元D轮融资，由谷歌、英伟达领投。其创立于2017年，2025年3月推出Maestro平台，能提升主流模型指令遵循准确性，弥合不同模型能力差距。<a href="https://mp.weixin.qq.com/s?__biz=Mzg3Mzg5MjY3Nw==&amp;chksm=cf85c007d244815e4a5ef949a41bc6635df36387224ba219d40839e1c3fc2f16eb935e202da6&amp;idx=3&amp;mid=2247520921&amp;sn=716e33652c386df8ebb0a2c0c4e7d1de#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><h3 id="黄仁勋-英伟达全员拥抱智能体" tabindex="-1"><a class="header-anchor" href="#黄仁勋-英伟达全员拥抱智能体"><span>黄仁勋：英伟达全员拥抱智能体</span></a></h3><p>黄仁勋：英伟达全员配AI助手，未来5 - 10年AI智能体成主流。小扎、纳德拉等也看好AI重塑开发者角色。AI编程工具变革开发，虽有局限但企业已广泛应用。<a href="https://mp.weixin.qq.com/s?__biz=MzI3MTA0MTk1MA==&amp;chksm=f01d5580838e402379229120e67b331b5bcfa56db44fb9e965de26abd7dc2fa3dea8e9b82095&amp;idx=2&amp;mid=2652593095&amp;sn=78043090438b28ecc36dba721e9aec29#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><h3 id="openai与微软洽谈融资筹备ipo" tabindex="-1"><a class="header-anchor" href="#openai与微软洽谈融资筹备ipo"><span>OpenAI与微软洽谈融资筹备IPO</span></a></h3><p>金融时报称OpenAI与微软正重新洽谈合作条款筹备IPO，关键在于微软投资回报的股权分配。此前OpenAI放弃转型计划但保留转公益公司想法，微软对其发展至关重要。<a href="https://mp.weixin.qq.com/s?__biz=Mzg3Mzg5MjY3Nw==&amp;chksm=cf9d0415220e0c13cfcdb26cb700563f4d072ca5e77e4c690ee99c27dd29b022a24b1c4774ef&amp;idx=1&amp;mid=2247520921&amp;sn=a2a9135fa63fd748dafe7b93758af349#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><h3 id="ai逼疯科技七巨头" tabindex="-1"><a class="header-anchor" href="#ai逼疯科技七巨头"><span>AI逼疯科技七巨头</span></a></h3><p>AI浪潮下，科技七巨头深陷危机。谷歌搜索受冲击，苹果AI进展慢，Meta推AI伙伴，特斯拉销量下滑。新兴模型崛起带来变数，大公司若固守旧模式，或成AI时代「诺基亚」。<a href="https://mp.weixin.qq.com/s?__biz=MzI3MTA0MTk1MA==&amp;chksm=f06cbd236e8fa27df0ce57e77d2dcc6ebea9fcfcf5042ed04ba822fa1ef218cfabdc7fe41d55&amp;idx=1&amp;mid=2652593095&amp;sn=e118f937170dd7962f81627c834522e5#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><h3 id="meta大会挑战openai-大佬激辩" tabindex="-1"><a class="header-anchor" href="#meta大会挑战openai-大佬激辩"><span>Meta大会挑战OpenAI，大佬激辩</span></a></h3><p>Meta在LlamaCon推出Meta AI和Llama API挑战OpenAI，扎克伯格视DeepSeek、Qwen为盟友。他与纳德拉探讨开源闭源生态，认为开源有优势；还谈及AI生产力提升及“蒸馏工厂”设想。<a href="https://mp.weixin.qq.com/s?__biz=MzU1NDA4NjU2MA==&amp;chksm=fa09169afa10683ae3161d7758c5355acb81158d0d1423836d497e66344b8993faee8b32a340&amp;idx=2&amp;mid=2247638789&amp;sn=f09df10e13284f575fadbb02e0249959#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><h3 id="amd财报佳-挑战英特尔英伟达" tabindex="-1"><a class="header-anchor" href="#amd财报佳-挑战英特尔英伟达"><span>AMD财报佳，挑战英特尔英伟达</span></a></h3><p>海豚君：AMD 2025年Q1财报亮眼，营收和利润双增，客户端业务超预期，桌面CPU份额反超英特尔；数据中心业务增长，但GPU待新品。不过，MI308出口受限或影响后续业绩。<a href="https://mp.weixin.qq.com/s?__biz=MzIwMzgzNTQ1Nw==&amp;chksm=977dc97f8591d4e57296d35506743a49eeafa34cfbebb83129bf8cd2b835e57d0c491b0cecd9&amp;idx=2&amp;mid=2247650767&amp;sn=237afd4a4d1b09c4da95c2e72d57d5bf#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><h3 id="红杉峰会-ai卖收益时代来临" tabindex="-1"><a class="header-anchor" href="#红杉峰会-ai卖收益时代来临"><span>红杉峰会：AI卖收益时代来临</span></a></h3><p>红杉AI峰会：AI不再卖工具，而是卖收益。SaaS逻辑失灵，新定价看KPI。AI入口争夺激烈，智能体经济成型，产品重结果，组织架构要适配，管理逻辑也被重写，AI成新型经济起点。<a href="https://mp.weixin.qq.com/s?__biz=Mzg5NTc0MjgwMw==&amp;chksm=c12fcf4fb8bfef44425debd4d011441a1a5d3adf875ba145d85800ed2070f7f231643636634e&amp;idx=1&amp;mid=2247516135&amp;sn=a96d3a9a56cfcab74a31899bc9bd8a3c#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><h3 id="iccv-2025评审风波不断" tabindex="-1"><a class="header-anchor" href="#iccv-2025评审风波不断"><span>ICCV 2025评审风波不断</span></a></h3><p>ICCV 2025投稿量破纪录，评审结果遭网友吐槽，有人称不如GPT。作者不满全员审稿制度，谷歌研究员刘若茜认为规定荒谬。同行评审也暴露官僚问题，评审质量应重洞察而非形式。<a href="https://mp.weixin.qq.com/s?__biz=MzI3MTA0MTk1MA==&amp;chksm=f041a9bf8fd58b98644b715407b704780781c8451820eb7e1ab21886fd60c745534acc157d12&amp;idx=1&amp;mid=2652593122&amp;sn=b412e88fa093c06a220f611d2ebb5f49#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><h2 id="产品应用" tabindex="-1"><a class="header-anchor" href="#产品应用"><span>产品应用</span></a></h2><h3 id="gemini-2-5-pro-长文转小红书图神器" tabindex="-1"><a class="header-anchor" href="#gemini-2-5-pro-长文转小红书图神器"><span>Gemini 2.5 Pro：长文转小红书图神器</span></a></h3><p>AI产品黄叔：Gemini 2.5 Pro能将长文一键转小红书爆款图。分享提示词结构与使用方法，还能借AI调整风格。不过系统有生成不稳定、下载有差异等局限。<a href="https://mp.weixin.qq.com/s?__biz=MjM5ODU1MzQzOQ==&amp;chksm=b06af46e6b001963ae0ce7ac9ecb9d4789fcd446b12efcd2509497acbbd3e57f98c003aebf6d&amp;idx=1&amp;mid=2451426381&amp;sn=256184b5dbcf69338168cf84322aa151#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><h3 id="黄益贺-cursor是最强知识库应用" tabindex="-1"><a class="header-anchor" href="#黄益贺-cursor是最强知识库应用"><span>黄益贺：Cursor是最强知识库应用</span></a></h3><p>黄益贺：Cursor是最强知识库应用，有RAG能力，能处理多类型文件、创建文档、联网搜索且支持新模型。他分享用Cursor配合文档工作规则，按此流程答案兼顾多方且逻辑性强。<a href="https://mp.weixin.qq.com/s?__biz=MzkyNzU0MzQwOQ==&amp;chksm=c3c3dcfd37adf1b1979ce75f7e84f1af9d96337edca843adc19997ecf477bcb037d404b413a0&amp;idx=1&amp;mid=2247484313&amp;sn=9df4d0f85db0f13ab142b635c7edb1dc#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><h3 id="void-cursor开源平替来袭" tabindex="-1"><a class="header-anchor" href="#void-cursor开源平替来袭"><span>Void：Cursor开源平替来袭</span></a></h3><p>小G：新工具 Void 是 Cursor 和 GitHub Copilot 开源平替，免费且功能强大，能直连 AI 模型，基于 VS Code 开发，上手和构建步骤明确。<a href="https://mp.weixin.qq.com/s?__biz=MzkxNjQ4MzMyOA==&amp;chksm=c052b82a26db1437420976b0c11e4e85c56cf444accb30848ad74151b5779a0257fd2ea0c3ed&amp;idx=1&amp;mid=2247493111&amp;sn=84bedf44a77a97a60e69f3b924e9c429#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><h2 id="推荐文章" tabindex="-1"><a class="header-anchor" href="#推荐文章"><span>推荐文章</span></a></h2><h3 id="karpathy揭秘llm学习第三范式" tabindex="-1"><a class="header-anchor" href="#karpathy揭秘llm学习第三范式"><span>Karpathy揭秘LLM学习第三范式</span></a></h3><p>Andrej Karpathy：当前LLM学习范式缺失‘系统提示词学习’。Claude系统提示词印证大量问题解决策略靠人工，理想是通过该学习产生，还有很多细节待明确。<a href="https://mp.weixin.qq.com/s?__biz=Mzg3MTkxMjYzOA==&amp;chksm=cf4edfd4f96a5eacada753848544398bd72b97ce0a72a309f354fc38304e0d58521a39f3ce66&amp;idx=1&amp;mid=2247504480&amp;sn=cb668668d10b7372ae6eaed3d7a9f43d#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><h3 id="李静海团队谈未来数据系统架构" tabindex="-1"><a class="header-anchor" href="#李静海团队谈未来数据系统架构"><span>李静海团队谈未来数据系统架构</span></a></h3><p>李静海院士团队：科学数据系统面临挑战，收集处理应遵循特定原则，重构AI模型逻辑。要重视数据系统逻辑与架构研究，建立标准框架，应对AI时代新挑战。<a href="https://mp.weixin.qq.com/s?__biz=MzU4ODk1NDUwOA==&amp;chksm=fce89929b9996956efda9c6c505f087f9f0ead9a0059eb1d841cba7057b542acc6c9a28f75bb&amp;idx=1&amp;mid=2247514117&amp;sn=ff9b9646af483e7e381142194e14dc53#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><h2 id="开源动态" tabindex="-1"><a class="header-anchor" href="#开源动态"><span>开源动态</span></a></h2><h3 id="卡内基梅隆大学开源legogpt" tabindex="-1"><a class="header-anchor" href="#卡内基梅隆大学开源legogpt"><span>卡内基梅隆大学开源LegoGPT</span></a></h3><p>卡内基梅隆大学：提出LegoGPT，可依文本提示生成物理稳定乐高模型。构建数据集训练模型，设计能手动或机器人组装，还开发纹理生成法，生成过程有验证和回滚机制。<a href="https://mp.weixin.qq.com/s?__biz=MzkzNTY3NjM1Ng==&amp;chksm=c39008911938cc2fa23138ac6f0173470c8708fbd22b3e8d26602a5f4afeb142bc5d1b49714b&amp;idx=1&amp;mid=2247491943&amp;sn=871e2216e50795b26816055011d23818#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><h3 id="陶哲轩用ai-33分钟盲证数学" tabindex="-1"><a class="header-anchor" href="#陶哲轩用ai-33分钟盲证数学"><span>陶哲轩用AI 33分钟盲证数学</span></a></h3><p>陶哲轩：开源数学概念验证工具迭代至2.0版，支持渐近估计，上手简单。还借助AI 33分钟“盲做”数学证明，让AI接管繁琐推理，重塑研究范式。<a href="https://mp.weixin.qq.com/s?__biz=MzI3MTA0MTk1MA==&amp;chksm=f0808490da1a2ff36127c032ae1912ff622925c791e1dbda092b74d180a61a916d804ba50507&amp;idx=1&amp;mid=2652593119&amp;sn=1b3a2dfac6d4bcfe180a4d66287ae520#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><h3 id="本周推荐6个超赞开源项目" tabindex="-1"><a class="header-anchor" href="#本周推荐6个超赞开源项目"><span>本周推荐6个超赞开源项目</span></a></h3><p>开源君推荐6个Github开源项目：Lazygit让Git操作更高效；Logan助美团定位端上问题；Ciphey一键解密；gocron可视化管理定时任务；nps轻量内网穿透；anx-reader集成AI的电子书阅读器。<a href="https://mp.weixin.qq.com/s?__biz=MzkwNzU4NTMyMA==&amp;chksm=c1a66520e48a14413f27c881c39e5d8764cb01dc4de69f570501caa3d0955dbb597a38869891&amp;idx=1&amp;mid=2247495803&amp;sn=7434ba1194dd57387387d6fc8c32c6ea#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><h3 id="字节8b代码模型超越百亿级对手" tabindex="-1"><a class="header-anchor" href="#字节8b代码模型超越百亿级对手"><span>字节8B代码模型超越百亿级对手</span></a></h3><p>字节Seed - Coder团队：让LLM自己筛选数据训练自己，打造8B参数代码模型，性能超百亿级对手，虽有通用和数学能力短板，但有望成程序员“超级助手”。<a href="https://mp.weixin.qq.com/s?__biz=MzI3ODgwODA2MA==&amp;chksm=ea33eed932515358b8f5c08e0cc101f6163e35e263d201b366cc797247b0b1e1ffa90847f3f2&amp;idx=1&amp;mid=2247538683&amp;sn=b0ee9b0cabc8e87290c38ae45a79377d#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><h3 id="ace-step-20秒生成4分钟神曲" tabindex="-1"><a class="header-anchor" href="#ace-step-20秒生成4分钟神曲"><span>ACE - Step：20秒生成4分钟神曲</span></a></h3><p>ACE Studio和阶跃星辰：联合推出开源音乐模型ACE - Step，20秒生成4分钟歌曲，比传统快15倍，支持19种语言，功能丰富，适用于多场景，值得一试。<a href="https://mp.weixin.qq.com/s?__biz=MzkwMjQ0NzI0OQ==&amp;chksm=c11e2a5ad07b88a0da42edb108534ae36dedc08845cbd68cf5a0e143211368d95a6a1546b37b&amp;idx=1&amp;mid=2247502202&amp;sn=b943386b0edc28a390d3bfa6f108504e#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><h2 id="算法论文" tabindex="-1"><a class="header-anchor" href="#算法论文"><span>算法论文</span></a></h2><h3 id="模型合并让vlm推理能力飙升" tabindex="-1"><a class="header-anchor" href="#模型合并让vlm推理能力飙升"><span>模型合并让VLM推理能力飙升</span></a></h3><p>论文《Bring Reason to Vision》：当前VLM有数据和结构问题，提出模型合并方案，从纯文本模型提取推理能力注入VLM，实验使数学题得分提升，揭示层间能力分布。<a href="https://mp.weixin.qq.com/s?__biz=MzI3ODgwODA2MA==&amp;chksm=eaee2982e68b367b92be95deaddcb0db24c7b02efbadaf57cae2fb2d03418ba4bb06a546ea0c&amp;idx=2&amp;mid=2247538683&amp;sn=6145b3b302e97dd7de4c7abaf1432c4d#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><h2 id="其他" tabindex="-1"><a class="header-anchor" href="#其他"><span>其他</span></a></h2><h3 id="_1-算法岗校招经验大揭秘" tabindex="-1"><a class="header-anchor" href="#_1-算法岗校招经验大揭秘"><span>1. 算法岗校招经验大揭秘</span></a></h3><p>作者认为算法岗校招没那么难，扎实基础就能成offer收割机。算法与开发岗在学习、需求、面试难度有别，刷题有顺序和数量建议，校招要做好准备再投递，别被焦虑影响。<a href="https://mp.weixin.qq.com/s?__biz=Mzg2ODExMjc4NQ==&amp;chksm=cf71ffc8d1635abbbc5dfb8288bac2ef424b4652a563434e64b419ebbf9110f79c38c2f7c768&amp;idx=1&amp;mid=2247489428&amp;sn=e4dd1cab16af9dfbc9581d79b755ef5a#rd" target="_blank" rel="noopener noreferrer">&gt;阅读原文</a></p><p style="text-align:center;"><img src="https://mmbiz.qpic.cn/sz_mmbiz_png/nUdl0pLHXXYY3LiaoXGeYrvCyMouK7WnJ35tic6NtXT3dy4icpz7ep1B27hGiahgQ1Gicj8qSjJzlo8g761N4P7ibgOg/640?wx_fmt=png&amp;from=appmsg" style="max-width:800px;object-fit:cover;"></p>',55)]))}const l=a(i,[["render",c]]),s=JSON.parse('{"path":"/posts/2025-05-12.html","title":"2025-05-12AI日报：微软财报：云与AI业务增长猛; Morgan Stanley：中国GPU自给率将大增; 谷歌发布AI智能体白皮书","lang":"zh-CN","frontmatter":{"date":"2025-05-12T00:00:00.000Z","title":"2025-05-12AI日报：微软财报：云与AI业务增长猛; Morgan Stanley：中国GPU自给率将大增; 谷歌发布AI智能体白皮书"},"headers":[{"level":2,"title":"新闻资讯","slug":"新闻资讯","link":"#新闻资讯","children":[{"level":3,"title":"微软财报：云与AI业务增长猛","slug":"微软财报-云与ai业务增长猛","link":"#微软财报-云与ai业务增长猛","children":[]},{"level":3,"title":"Morgan Stanley：中国GPU自给率将大增","slug":"morgan-stanley-中国gpu自给率将大增","link":"#morgan-stanley-中国gpu自给率将大增","children":[]},{"level":3,"title":"谷歌发布AI智能体白皮书","slug":"谷歌发布ai智能体白皮书","link":"#谷歌发布ai智能体白皮书","children":[]},{"level":3,"title":"AI21 Labs获3亿美元融资","slug":"ai21-labs获3亿美元融资","link":"#ai21-labs获3亿美元融资","children":[]},{"level":3,"title":"黄仁勋：英伟达全员拥抱智能体","slug":"黄仁勋-英伟达全员拥抱智能体","link":"#黄仁勋-英伟达全员拥抱智能体","children":[]},{"level":3,"title":"OpenAI与微软洽谈融资筹备IPO","slug":"openai与微软洽谈融资筹备ipo","link":"#openai与微软洽谈融资筹备ipo","children":[]},{"level":3,"title":"AI逼疯科技七巨头","slug":"ai逼疯科技七巨头","link":"#ai逼疯科技七巨头","children":[]},{"level":3,"title":"Meta大会挑战OpenAI，大佬激辩","slug":"meta大会挑战openai-大佬激辩","link":"#meta大会挑战openai-大佬激辩","children":[]},{"level":3,"title":"AMD财报佳，挑战英特尔英伟达","slug":"amd财报佳-挑战英特尔英伟达","link":"#amd财报佳-挑战英特尔英伟达","children":[]},{"level":3,"title":"红杉峰会：AI卖收益时代来临","slug":"红杉峰会-ai卖收益时代来临","link":"#红杉峰会-ai卖收益时代来临","children":[]},{"level":3,"title":"ICCV 2025评审风波不断","slug":"iccv-2025评审风波不断","link":"#iccv-2025评审风波不断","children":[]}]},{"level":2,"title":"产品应用","slug":"产品应用","link":"#产品应用","children":[{"level":3,"title":"Gemini 2.5 Pro：长文转小红书图神器","slug":"gemini-2-5-pro-长文转小红书图神器","link":"#gemini-2-5-pro-长文转小红书图神器","children":[]},{"level":3,"title":"黄益贺：Cursor是最强知识库应用","slug":"黄益贺-cursor是最强知识库应用","link":"#黄益贺-cursor是最强知识库应用","children":[]},{"level":3,"title":"Void：Cursor开源平替来袭","slug":"void-cursor开源平替来袭","link":"#void-cursor开源平替来袭","children":[]}]},{"level":2,"title":"推荐文章","slug":"推荐文章","link":"#推荐文章","children":[{"level":3,"title":"Karpathy揭秘LLM学习第三范式","slug":"karpathy揭秘llm学习第三范式","link":"#karpathy揭秘llm学习第三范式","children":[]},{"level":3,"title":"李静海团队谈未来数据系统架构","slug":"李静海团队谈未来数据系统架构","link":"#李静海团队谈未来数据系统架构","children":[]}]},{"level":2,"title":"开源动态","slug":"开源动态","link":"#开源动态","children":[{"level":3,"title":"卡内基梅隆大学开源LegoGPT","slug":"卡内基梅隆大学开源legogpt","link":"#卡内基梅隆大学开源legogpt","children":[]},{"level":3,"title":"陶哲轩用AI 33分钟盲证数学","slug":"陶哲轩用ai-33分钟盲证数学","link":"#陶哲轩用ai-33分钟盲证数学","children":[]},{"level":3,"title":"本周推荐6个超赞开源项目","slug":"本周推荐6个超赞开源项目","link":"#本周推荐6个超赞开源项目","children":[]},{"level":3,"title":"字节8B代码模型超越百亿级对手","slug":"字节8b代码模型超越百亿级对手","link":"#字节8b代码模型超越百亿级对手","children":[]},{"level":3,"title":"ACE - Step：20秒生成4分钟神曲","slug":"ace-step-20秒生成4分钟神曲","link":"#ace-step-20秒生成4分钟神曲","children":[]}]},{"level":2,"title":"算法论文","slug":"算法论文","link":"#算法论文","children":[{"level":3,"title":"模型合并让VLM推理能力飙升","slug":"模型合并让vlm推理能力飙升","link":"#模型合并让vlm推理能力飙升","children":[]}]},{"level":2,"title":"其他","slug":"其他","link":"#其他","children":[{"level":3,"title":"1. 算法岗校招经验大揭秘","slug":"_1-算法岗校招经验大揭秘","link":"#_1-算法岗校招经验大揭秘","children":[]}]}],"git":{"updatedTime":1751170504000,"contributors":[{"name":"GitHub Actions","username":"","email":"actions@github.com","commits":1}],"changelog":[{"hash":"bb9dc39f7f55c242909b553e28515d0713e83805","time":1751170504000,"email":"actions@github.com","author":"GitHub Actions","message":"Auto-commit generated files on 2025-06-29T04:15:04.814Z"}]},"filePathRelative":"posts/2025-05-12.md","excerpt":"<blockquote>\\n<p>All in AI，看见未来。 每天精选最值得读的AI文章，帮你筛掉时代的噪音。 以简讯见广度，以深读见洞察。 技术、趋势、思考，一站式掌握AI世界。</p>\\n</blockquote>\\n<h1>2025-05-12 资讯日报</h1>\\n<h2>新闻资讯</h2>\\n<h3>微软财报：云与AI业务增长猛</h3>\\n<p>微软2025财年Q3财报亮眼，营收701亿美元。董事长Satya Nadella：云与AI是企业关键；CFO Amy Hood：云业务营收424亿美元，因产品需求旺，业绩强劲。<a href=\\"https://mp.weixin.qq.com/s?__biz=Mzg3Mzg5MjY3Nw==&amp;chksm=cf0046c28178217bb5f5df15d8387ab2bd76ddf587c0d3572d1dddce466ee8c92a8a168ef1fe&amp;idx=2&amp;mid=2247520921&amp;sn=6f0fdd5a25a8027cb7266611ee041396#rd\\" target=\\"_blank\\" rel=\\"noopener noreferrer\\">&gt;阅读原文</a></p>"}');export{l as comp,s as data};
